import { Component, OnInit, Output, EventEmitter } from '@angular/core';
import { ProductsService } from '../services/products.service';
@Component({
  selector: 'app-sidebar',
  templateUrl: './sidebar.component.html',
  styleUrls: ['./sidebar.component.css']
})
export class SidebarComponent implements OnInit {
  @Output() typeChanged: EventEmitter<string> = new EventEmitter()

  constructor() { }

  ngOnInit(): void {
  }

  changeToTablet(){
    this.typeChanged.emit('Tablet');
  }

  changeToMobile(){
    this.typeChanged.emit('Mobile');
  }

  changeToPc(){
    this.typeChanged.emit('Pc');
  }

}
<div class="d-flex flex-column flex-shrink-0 p-3 bg-light" style="width: 280px;">
  <span class="fs-4">Choose Category</span>
  <ul class="nav nav-pills flex-column mb-auto">
    <li class="nav-item">
      <button (click)="changeToTablet()" class="nav-link link-dark" aria-current="page">
        Tablet
      </button>
    </li>
    <li>
      <button (click)="changeToMobile()" class="nav-link link-dark">
        Mobile
      </button>
    </li>
    <li>
      <button (click)="changeToPc()" class="nav-link link-dark">
        Pc
      </button>
    </li>
  </ul>
</div>
